import React from "react";
import "./style.css"; // Import your CSS file

function MonthSpendCarousel() {
  return (
    <div className="slider">
      <div className="slide-track">
        <div className="slide">문준호</div>
        <div className="slide">손수형</div>
        <div className="slide">차지은</div>
        <div className="slide">황준혁</div>
        <div className="slide">송소연</div>
        <div className="slide">유민국</div>
        <div className="slide">컨설턴트님</div>
        <div className="slide">코치님</div>
      </div>
    </div>
  );
}

export default MonthSpendCarousel;
